import React from 'react'
import { Link } from "react-router-dom";

const CreateTips=()=>{
  const [id, setId] = React.useState(0);
  const [date, setDate] = React.useState("");
  const [tipAmount, setTipAmount] = React.useState("");
  const [savingsRate, setSavingsRate] = React.useState("");
  const [amountSaved, setAmountSaved] = React.useState("");

  const onDateInput=(e)=>{
    this.setState({date:e.target.value})
  }
  const onTipAmountInput=(e)=>{
    this.setState({tipAmount:e.target.value})
  }
  const onSavingsRateInput=(e)=>{
    this.setState({savingsRate:e.target.value})
  }
  const onAmountSavedInput=(e)=>{
    this.setState({amountSaved:e.target.value})
  }
  return(
    <div>
      This is my formpage page
      <input type="date" value={date} onClick={onDateInput} placeholder="Date"></input>
      <input type="number" value={tipAmount} onClick={onTipAmountInput} placeholder="Tip Amount"></input>
      <select type="date" value={savingsRate} onClick={onSavingsRateInput}>
        <option>Savings Rate%</option>
        <option value=".15">15%</option>
        <option value=".20">20%</option>
        <option value=".25">25%</option>
      </select>
      <input type="number" value={amountSaved} onClick={onAmountSavedInput} placeholder="savingsRate"></input>
      <Link to="/tips">Add Tips</Link>
    </div>
  )
}
export default CreateTips
